<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>File Manager</title>
    <style>
        body { font-family: Arial, sans-serif; background-color: #2b2bc4; margin: 0; padding: 0; }
        .container { width: 80%; margin: 0 auto; }
        header { background-color: #23dedb; color: white; padding: 10px 0; text-align: center; }
        nav { background-color: #333; overflow: hidden; }
        nav a { color: white; padding: 14px 20px; text-decoration: none; display: inline-block; }
        nav a:hover { background-color: #ddd; color: black; }
        .file-list { margin-top: 20px; }
        table { width: 100%; border-collapse: collapse; }
